import './App.css';
import Bio from './components/Bio.js';

function App() {
  return (
	  <div className="App">
	  <div id="profile-pic">
	  <img src="./images/profile_pic.jpg" alt="Profile picture: Alex Trenam"/>
	  </div>
	  <Bio/>
	  </div>
  );
}

export default App;
